import axios from 'axios'
const baseUrl = "http://localhost:8000"



export async function sendMenssage({subject,from_email,message}){
    console.log(subject)
    console.log(from_email)
try {
    await axios.post({
        url:`${baseUrl}/contactanos`,
        params:{
            subject:{subject},
            from_email:{from_email},
            message:{message}
        }

    })
    console.log('exito')
} catch (e) {
    console.log('Fail')
    console.log(e)
}
}
